  width: 0;
  border-width: 10px;
  border-color: transparent;
  border-top-color: #ccc;
}
.sendpulse-fab .sendpulse-prompt-message:after {
  border-top-color: #fff;
  bottom: -20px;
}
.sendpulse-fab .sendpulse-prompt-fab {
  padding: 10px;
  width: 48px;
  height: 48px;
  text-align: center;
  border-radius: 50%;
  background-color: #31B58E;
  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.2);
  cursor: pointer;
  box-sizing: border-box;
  line-height: 1.2;
  -webkit-transition: box-shadow 200ms ease 50ms;
  -moz-transition: box-shadow 200ms ease 50ms;
  -ms-transition: box-shadow 200ms ease 50ms;
  -o-transition: box-shadow 200ms ease 50ms;
  transition: box-shadow 200ms ease 50ms;
}
.sendpulse-fab .sendpulse-prompt-fab .sendpulse-bell-icon {
  margin: auto;
  width: 24px;
  height: 24px;
  top: 2px;
}
.sendpulse-fab .sendpulse-prompt-fab use.sendpulse-bell-path {
  fill: #fff;
}
.sendpulse-fab .sendpulse-prompt-close,
.sendpulse-fab .sendpulse-prompt-btn {
  display: none !important;
}
.sendpulse-fab .sp-link-wrapper {
  display: block;
  margin-bottom: 4px;
}
.sendpulse-fab .sendpulse-prompt-message {
  visibility: hidden;
  opacity: 0;
  -webkit-transform: scale(0.9);
  transform: scale(0.9);
  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.15);
  -webkit-transition: all 100ms ease 50ms;
  -moz-transition: all 100ms ease 50ms;
  -ms-transition: all 100ms ease 50ms;
  -o-transition: all 100ms ease 50ms;
  transition: all 100ms ease 50ms;
}
.sendpulse-fab:hover .sendpulse-prompt-message {
  visibility: visible;
  opacity: 1;
  -webkit-transform: scale(1);
  transform: scale(1);
}
.sendpulse-fab:hover .sendpulse-prompt-fab {
  box-shadow: 0 0 0 2px #fff, 0 4px 10px rgba(0, 0, 0, 0.3);
}
/* ------- prompt-backdrop-info ------- */
.sendpulse-backdrop-info {
  position: fixed;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
  z-index: 999996;
  background: rgba(0, 0, 0, 0.65);
  text-align: center;
  opacity: 0;
  -webkit-transition: all 200ms ease 100ms;
  -moz-transition: all 200ms ease 100ms;
  -ms-transition: all 200ms ease 100ms;
  -o-transition: all 200ms ease 100ms;
  transition: all 200ms ease 100ms;
}
.sendpulse-backdrop-info.show-prompt {
  display: block !important;
  opacity: 1;
}
.sendpulse-backdrop-info .backdrop-close {
  position: absolute;
  color: #fff;
  right: 20px;
  top: 20px;
  font-family: 'Segoe UI', 'Open Sans', Ubuntu, 'Dejavu Sans', Helvetica, 'Helvetica Neue', Arial, sans-serif;
  font-weight: 300;
  opacity: 0.8;
  cursor: pointer;
}
.sendpulse-backdrop-info .backdrop-close:hover {
  opacity: 1;
}
.sendpulse-backdrop-info .backdrop-close > big {
  font-size: 60px;
  line-height: 20px;
}
.sendpulse-backdrop-info .backdrop-close > small {
  font-size: 16px;
}
.sendpulse-backdrop-info .backdrop-message {
  position: fixed;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
  z-index: 999997;
  position: absolute;
  max-width: 360px;
  color: #fff;
  margin-top: 150px;
  margin: 36vh auto 10vh auto;
  font-size: 21px;
  padding: 20px;
  font-family: 'Segoe UI', 'Open Sans', Ubuntu, 'Dejavu Sans', Helvetica, 'Helvetica Neue', Arial, sans-serif;
  font-weight: 500;
}
