                        <p class="m-t-25"><em>Mir wurde ganz schlecht. Ich dachte, ich wäre betrogen worden. Ich wollte schon meinen persönlichen Investor anrufen und mein Geld zurückverlangen. Aber dann fiel mir ein, was er mir während unseres Telefonats gesagt hatte: Der Algorithmus hat zu 80 bis 89% der Zeit recht. Sie werden nicht bei JEDEM Handel gewinnen, aber Sie gewinnen genug, um insgesamt profitabel zu sein. </em></p>

